import React from 'react';

function MovieList({movies}){
    return (
        <ul>
            {movies.map(movie => (
                <li key={movie.id}>
                    {movie.title} ({movie.year}): {movie.grades}
                </li>
            ))}
        </ul>
    );
}

export default MovieList;
